import React from "react";

const Experience = () => {
  return (
    <div className="experience">
      <div>
        <h2>Développeur React JS et Node JS ( En apprentissage)<br />Wild Code School : Mai 2020 à Déçembre 2020</h2>
        <p>- Participation a  un hackathon  pour relever les défis
        de l’e-santé et la télémédecine, en partenariat avec Doctolib & Dataiku,
            d'une durée de 48H ( en juin 2020 ).<br />
           - Création d'un site vitrine en équipe ( en HTML5, CSS3 et JavaScript ).</p>

      </div>
      <div>
        <h2>Gérant d'Entreprise Commerce de Détail et Restauration Collective.</h2>
        <p>Achat et vente de Produits Alimentaires divers à Lyon : Les principales missions
        que j'ai mené ont consisté à : la Gestion comptable et administrative;
        Gérer les moyens budgétaires et matériels de la structure ou planifier les opérations
        financières; Accueillir, conseiller et encaisser la clientèle; Commander la marchandise
             à mettre en vente; Veiller au réapprovisionnement des stocks.</p>

      </div>
      <div>
        <h2>Gérant Commerce de Détail<br />Auto-Entrepreneur : Juin 2012 à Novembre 2014</h2>
        <p>Vente de produit alimentaires divers, préparer les marchandises et les emballer dans des
        caisses, veiller à la gestion de ses stocks et à leur réapprovisionnement. En cas d’affluence,
           il faut s’organiser pour servir tous les clients dans les meilleurs délais.</p>

      </div>
      <div>
        <h2>Réceptionniste-équipier polyvalent<br />SARL EVE : Mai 2009 à Juin 2012</h2>
        <p>Blanchisserie, laverie, location de linge, nettoyage, pressing et teinturerie, et les missions principales étaient :
        - Accueillir les Clients;
        - Renseignements;
        - Standard Téléphonique;
        - Enregistrement des produits;
        - Encaissement;
        - Organisation du lieu du travail;
- Comptabilité Journalière;</p>
      </div>
    </div>
  );
};

export default Experience;
